Something we're keen on doing is not just adding support for ?async and to apply to functions, traits, and trait bounds. We would like ?async to be possible to use with types as well. This would enable the ecosystem to stop having to provide both sync and async versions of crates. It would also enable the stdlib to gradually "asyncify" just like we have been with const. The challenge with async types, especially in the stdlib, is that their behavior will often have to be different when used in async and non-async contexts. At the very lowest level async system calls work a bit differently from non-async system calls. But we think we may have a solution for that too in the form of the is_async compiler built-in method. Say we wanted to implement ?async File with a single ?async open method. The way we expect this to look will be something like this: /// A file which may or may not be async
struct ?async File { file_descriptor: std::os::RawFd, // shared field in all contexts async waker: Waker, // field only available in async contexts !async meta: Metadata, // field only available in non-async contexts
} impl ?async File { /// Attempts to open a file in read-only mode. ?async fn open(path: Path) -> io::Result<Self> { if is_async() { // compiler built-in function // create an async `File` here; can use `.await` } else { // create a non-async `File` here } }
} This would enable authors to use different fields depending on whether they're compiling for async or not, while still sharing a common core. And within function bodies it would be possible to provide different behaviors depending on the context as well. The function body notation would work as a generalization of the currently unstable const_eval_select intrinsic, and at least for the function bodies we expect a similar is_const() compiler built-in to be made available as well.

