As we alluded to earlier in the post: one of the biggest challenges we see in language design is adding features in a way that makes them feel like they're in harmony with the rest of the language - and not something which stands out as noticably different. And because we're touching on something core to Rust, the way we do keywords, we have to pay extra close attention here to make sure Rust keeps feeling like a single language. Luckily Rust has the ability to make surface-level changes to the language through the edition system. There are many things this doesn't let us do, but it does allow us to require syntax changes. A possibility we're exploring is leveraging the edition system to make some minor changes to const and async so they feel more consistent with one another, and with ?const and ?async. For const this means there should be a syntactic distinction between const declarations and const uses. Like we mentioned earlier in the post, when you write const fn you get a function which can be evaluated both at runtime and during compilation. But when you write const FOO: () = ..; the meaning of const there guarantees compile-time evaluation. One keyword, different meanings. So for that reason we're wondering whether perhaps it would make more sense if we changed const fn to ?const fn. This would make it clear that it's a function which may be const-evaluated, but doesn't necessarily have to - and can also be called from non-const contexts. //! Define a function which may be evaluated both at runtime and during
//! compilation. // Current
const fn meow() -> String { .. } // Proposed
?const fn meow() -> String { .. } For async we're considering some similar surface-level changes. The Async WG is in the process of expanding the "async functions in traits" design into an design covering "async traits" entirely, largely motivated by the desire to be able to add + Send bound to anonymous futures. There are more details about this in ["Lightweight, Predictable Async Send Bounds"][bounds-post] by Eric Holk. But it would roughly become the following notation: struct File { .. }
impl async Read for File { // async trait declaration async fn read(&mut self, buf: &mut [u8]) -> io::Result<usize> { .. } // async method
} async fn read_to_string(reader: &mut impl async Read) -> io::Result<String> { // async trait bound let mut string = String::new(); reader.read_to_string(&mut string).await?; Ok(string)
} This would make impl ?async Read and impl async Read consistent with each other. And it would open the door for trait ?async traits to be passed to impl async Read and be guaranteed to be always interpreted as trait async. Which is another nice consistency gain. The final thing we're looking at is async-notation for types. To implement inherent ?async methods on types, our current design requires the type to also be marked as ?async. In order to bring ?async and async closer together, we're exploring whether it might also make sense to require types to be marked as async as well: //! Proposed: define a method on a maybe-async type
struct ?async File { .. }
impl ?async File { ?async fn open(path: PathBuf) -> io::Result<Self> { .. }
} //! Current: define a method on an always-async type
struct File { .. }
impl File { async fn open(path: PathBuf) -> io::Result<Self> { .. }
} //! Proposed: define a method on an always-async type
struct async File { .. }
impl async File { async fn open(path: PathBuf) -> io::Result<Self> { .. }
} We already have something similar going on for "always-const" arguments via the const-generics system. These look something like this: fn foo<const N: usize>() {} Every "always-const" argument to the function must always be marked by const, so it wouldn't be entirely without precedent for every "always-async" type to always require to be marked using async. So we're exploring some of what might be possible here.

